B.aWZ=new A.co("Il mio \xe8 un approccio di tipo sistemico-relazionale perch\xe9 credo fermamente che le relazioni siano ci\xf2 che ci mantiene in vita. Cambiare il punto di vista, vedere le cose da una diversa prospettiva ci permette di non vedere come sbagliate le nostre azioni ma solo come la cosa migliore che siamo riusciti a fare in quel momento e con quegli strumenti.\n\nLa terapia sistemica a cui facciamo riferimento \xe8 l\u2019insieme di conoscenze e tecniche che sono state elaborate a cavallo tra gli anni 60 e 70 a Milano da Mara Selvini Palazzoli, Luigi Boscolo, Gianfranco Cecchin e Giuliana Prata, conosciuto nel mondo come \u201cMilan Approach\u201d. I riferimenti teorici della Scuola di Milano sono numerosi e si sono evoluti nel tempo. Possiamo identificare come basi di partenza gli studi di Bateson e del gruppo di Palo Alto (Watzlawick, Beavin, Jackson, 1967), la teoria generale dei sistemi (von Bertalanffy, 1968), la cibernetica di primo ordine e, successivamente, la cibernetica di secondo ordine (von Foerster, 1987), il costruttivismo (Maturana e Varela, 1987) e il costruzionismo sociale (Gergen e McNamee, 1998).\n\nUno dei pilastri del modello milanese \xe8 il lavoro sulla comunicazione ed incarna la prospettiva per cui ogni sintomo \xe8 una forma di comunicazione dove la persona non \xe8 vista come una singola entit\xe0 ma come un individuo inserito all'interno di un sistema, nel quale agiscono azioni e controrelazioni.  Il concetto di sistema ci permette di ampliare la prospettiva di osservazione e, di conseguenza, le possibilit\xe0 di cambiamento. Se un sistema \xe8 un insieme di persone che comunicano fra loro ed intessono relazioni, allora quest\u2019insieme \xe8 pi\xf9 che la somma delle parti e l\u2019unit\xe0 di osservazione sar\xe0 la relazione e il contesto in cui essa si trova. Questo nella terapia implica l\u2019abbandono dell\u2019etichetta della patologizzazione e promuove l\u2019assunzione di una prospettiva che coglie la complessit\xe0 delle relazioni.\n\nTutti facciamo parte di diversi contesti di riferimento, come quello familiare, lavorativo o relazionale e all'interno di questi contesti agiscono delle forze che permettono al sistema di stare in equilibrio. Quando per\xf2 l'equilibrio si rompe entra in gioco la sofferenza. Il Milan Aproach \xe8 volto a non vedere come sbagliate le proprie azioni o i propri comportamenti, ma a vederli come la migliore cosa che l'individuo ha potuto fare in quel momento e con quegli strumenti.\n\nViene definito cos\xec un approccio polifonico: pi\xf9 voci permettono ad ognuno di trovare valore in ci\xf2 che dice trovando una nuova connessione col sistema. La polifonia delle voci e delle narrazioni costruisce un contesto in cui tutti i punti di vista sono importanti e legittimi e tutti insieme descrivono la realt\xe0. La qualit\xe0 del terapeuta \xe8 quella di saper mantenere curiosit\xe0 verso la relazione. Ogni sistema ha le sue proprie soluzioni, e la sfida del terapeuta sistemico \xe8 quella di scoprirle insieme a lui senza sovrapporre le proprie, poich\xe9 coesiste una molteplicit\xe0 di punti di vista. Grazie al Milan Aproach possiamo ampliare le possibili soluzioni al nostro problema, ampliare lo sguardo e trovare nuovi strumenti per superare la difficolt\xe0.",null,B.by,null,null,null,null,null,100,null,null)
