B.aWJ=new A.co("\n\nMi sono laureata presso l'Universit\xe0 degli studi di Padova nel 2019 con una tesi sulle implicazioni relazionali dell\u2019anoressia nervosa e ora sto svolgendo la specializzazione presso il Centro Milanese di Terapia della Famiglia di Milano per abilitarmi come terapeuta individuale, di coppia e familiare. \nNel 2020 ho svolto un corso post-laurea in psicodiagnostica clinica e giuridico-peritale che mi permette di poter lavorare come psicodiagnosta. \n\nA livello formativo ho svolto diversi tirocini all'interno dell'ULSS 2 di Treviso affiancando i tutor di riferimento nei reparti di oncologia, ematologia e la Breast Unit, unit\xe0 operativa specializzata per il tumore al seno. Questo mi ha permesso di fare esperienza nell'area della psiconcologia, attraverso attivit\xe0 clinica in reparto, colloqui individuali e familiari e attivit\xe0 di gruppo. \nHo lavorato all'interno dell'ambulatorio per la prevenzione, diagnosi e cura della depressione post partum dove venivano svolti colloqui di consulenza alle mamme ad alto rischio e ai propri familiari. Sono stata all'interno di una struttura residenziale per adolescenti con disturbi del comportamento alimentare e crisi adolescenziale. \nAttualmente opero all\u2019interno del Servizio Psichiatrico di Diagnosi e Cura, in una Comunit\xe0 Terapeutico Riabilitativa Protetta e nel Centro di Salute Mentale. Questo mi permette di stare a contatto con la malattia psichiatrica attraverso la co-conduzione di gruppi terapeutici con i pazienti, colloqui clinici individuali e gruppi psicoeducativi con i familiari.  \n\nNell'attivit\xe0 privata mi occupo di percorsi psicologici prevalentemente con adulti e adolescenti. Tratto principalmente disturbi del comportamento alimentare, disturbi d\u2019ansia, depressione e disturbi dell\u2019umore, depressione post partum e difficolt\xe0 del ciclo di vita. \nCome psicologa opero anche all\u2019interno dell\u2019Associazione L\u2019Abbraccio che si occupa di prevenzione e cura dei disturbi del comportamento alimentare. Sono referente clinico del gruppo di mutuo aiuto rivolto a genitori di pazienti che afferiscono all\u2019ambulatorio DCA di diversi distretti e promuovo attivit\xe0 di prevenzione e sensibilizzazione nelle scuole.",null,B.by,null,null,null,null,null,100,null,null)
